    `aftersale_id`  bigint(20) NULL DEFAULT NULL COMMENT '售后单id',
    `order_id`      bigint(20) NULL DEFAULT NULL COMMENT '订单id',
    `order_item_id` bigint(20) NULL DEFAULT NULL COMMENT '子订单id',
